import { Fragment } from "react";

const Laptop = ({brand,os}) => {
   return(
   <Fragment>
      <h1>해당 노트북은 {brand}입니다.</h1>
      <h1>해당 노트북의 운영체제는 {os}입니다.</h1>
   </Fragment>
   )
}

export default Laptop;
